import React from 'react';
import { GameState, RoomSocketMessage } from '../metadata/types';
import styled, { createGlobalStyle } from 'styled-components';
import SocketIOClient from 'socket.io-client';
import { Location } from 'history';
import queryString from 'query-string';
import axios from 'axios';

const Formstyle = styled.form`
  form{
    border-radius: 3px;
  }
  form>h1{
    text-align: center;
    background-color:rgba(164, 164, 164, 0);
    border-radius: 3px;
  }
  form>h6{
    text-align: center;
    background-color:rgba(164, 164, 164, 0);
    border-radius: 3px;
  }
`;


export default () => {
  return <div style={{ color: 'black' }}>
    <form action="login.php" method="post">
        <h1>Login</h1>
        <div className="form-group">
          Username:
          <input type="text" className="form-control" id="username" name="username" required></input>
        </div>
        <div className="form-group">
        </div>
        <div className="form-group">
          Password:
          <input type="password" className="form-control" id="password" name="password" required></input>
        </div>
        <button type="submit" className="btn btn-dark">Submit</button>
      </form>
      <form action="register.php" id="extra">
          <button type="submit" className="btn btn-dark">Register</button>
      </form>
  </div>;


}
